import React, { Component } from 'react'
import { render } from '@testing-library/react'

class App extends Component {
    Constructor() {

        this.state = {
            students:{}
  }
}

    componentDidMount() {

        fetch('http://localhost:5000/students/5e56725cc85b640444faed94')
            .then(response => response.json())
            .then(data => {
                this.setState({
                    students: data
                })
            })
    }
    render() {
        return (
            <div>
                {this.state.students.student}

            </div>
        )
    }
}

export default App
